import App from 'next/app'
import Layout from "../Layout/Layout";

class SupSafari extends App {
    render() {
        const { Component, pageProps } = this.props;

        return (
        <Layout>
            <Component {...pageProps} />
        </Layout>
        )
      }
  }

  export default SupSafari
